  [],\n\t\"revision_timestamp\": \"2015-05-07T00:50:07.017114\",\n\t\"name\": \"high-power-uplink-amplifier-for-deep-space-communications-project-7327f\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Critical to the success of delivering on
  the promise of deep space optical communications is the creation of a stable and
  reliable high power multichannel optical uplink/beacon. Optical Engines proposes
  to deliver in phase 2 2 compact and low cost fiber amplifiers suited to the uplink
  application. This will be accomplished through the use of Optical Engines proprietary
  Multi-Fiber Coupled 2.5kW laser diode stacks, its Etched Taper All Fiber Combiner
  Technology and a custom designed Photonic Crystal Fiber. One of these amplifiers
  will be of the Coiled PCF type and one of the Rod type and will be integrated into
  existing NASA deep space communications up link infrastructure.\",\n\t\"license_title\":
